import React from "react";
import ReadLater from "./ReadLater";

const ReadLaters = ({ articles, removeArticle }) => {
  return (
    <>
      {articles.map((article, i) => (
        <ReadLater key={i} article={article} removeArticle={removeArticle} />
      ))}
    </>
  );
};

export default ReadLaters;
